import React, {useEffect, useState} from "react";
import AddTest from "./AddTest";
import Output from "./Output";


const Test = () => {
    // const arrayvalue = ["bus", "cycle"] 

    const [list, setList] = useState(["bus", "cycle"])


    const addTest = (value) => {
        setList([...list,value])
    }
    return (
        <>
            <AddTest addTest ={addTest}/>
            <div>
                {
                    list.map((item,index) => {
                        return (
                            <div key={index}>
                                <li> {item}</li>  
                            </div>
                        )
                    })
                }
            </div>
            {/* <Output value ={list} /> */}
        </>
    )

}

export default Test;
